import React from 'react';
import ReactDOM from 'react-dom';

const fullName = "Nawaraj Luitel";
let current_date = new Date().toLocaleDateString();
let current_time = new Date().toLocaleTimeString();
let image ="https://picsum.photos/id/237/200/300";
let link ="https://www.w3schools.com/jsref/jsref_totimestring.asp";

ReactDOM.render(
  <>
    <h1>{`My name is ${fullName}`}</h1>
    <p contentEditable="False">The current date is {current_date}</p>
    <p>The current time is {current_time}</p>
    <img src={image} alt="A random photo" height="20px" width="20px"></img>
    <a>
      <img src={image} alt="A random photo" height="20px" width="20px"></img>
    </a>
  </>,

  document.getElementById('root')
);
